import React from "react";
import "../styles/login.css";

export default function Login() {
  return (
    <div className="wrap loginFields">
      <div id="login">
        <div id="LoginHeader">Communicator Login</div>
        <div className="loginEntry">
          <input name="txtBxUserName" type="text" value="training" id="txtBxUserName" className="textEntry" placeholder="Login Name"></input>
          <input name="txtBxPassword" id="txtBxPassword" className="textEntry" type="password" placeholder="Password"></input>
          <input name="txtBxCompanyId" type="text" value="1002" id="txtBxCompanyId" className="textEntry" placeholder="Company ID"></input>
        </div>
        <input type="submit" name="btnLoginButton" value="Log In" id="btnLoginButton" />
      </div>
      <div id="ssl">
          <p>TLS Enabled</p>
      </div>
    </div>
  );
}
